export function MatrixRotationAroundVectorPoint(t,n,o){const r=t[0],i=t[1],c=t[2],a=r*r,e=i*i,u=c*c,s=r*i,M=r*c,x=i*c,h=Math.sin(o),f=h*r,p=h*i,d=h*c,A=Math.cos(o),P=1-A,R=n[0],V=n[1],O=n[2];return[[a*P+A,s*P-d,M*P+p,(R*(1-a)-V*s-O*M)*P+V*d-O*p],[s*P+d,e*P+A,x*P-f,(V*(1-e)-R*s-O*x)*P+O*f-R*d],[M*P-p,x*P+f,u*P+A,(O*(1-u)-R*M-V*x)*P+R*p-V*f],[0,0,0,1]]}export function MatrixRotationAroundVector(t,n){const o=t[0],r=t[1],i=t[2],c=o*o,a=r*r,e=i*i,u=o*r,s=o*i,M=r*i,x=Math.sin(n),h=x*o,f=x*r,p=x*i,d=Math.cos(n),A=1-d;return[[c*A+d,u*A-p,s*A+f,0],[u*A+p,a*A+d,M*A-h,0],[s*A-f,M*A+h,e*A+d,0],[0,0,0,1]]}export function MatrixOnPoint(t,n){const o=n[0],r=n[1],i=n[2];return[t[0][0]*o+t[0][1]*r+t[0][2]*i+t[0][3],t[1][0]*o+t[1][1]*r+t[1][2]*i+t[1][3],t[2][0]*o+t[2][1]*r+t[2][2]*i+t[2][3]]}